import React from 'react';
import productDetails from './edata';
import Eproducts from './main';
// import './whoc.css';

class App extends React.Component 
 {
    render(){
        return(
        <div>
            <Eproducts data={productDetails}></Eproducts>
            {
  data.map((item) => (
    <div key={item.id}>
      <p>{item.pName}</p>
      <p>{item.price}</p>
    </div>
  ))
}
            
        </div>

        )    

    }

 } 

 export default App
